  {id: 1, layer_group_id: nil, name: "Cancer Incidence, ASR all years Globocan", slug: "incidence-asr-all-years-globocan", layer_type: "layer", zindex: 1, active: true, order: 0, color: nil, info: "<div> \r\n\t<h2>Incidence</h2>\r\n\t<p>\r\n\t\tGLOBOCAN 2012, IARC -11.8.2014: \r\n\t\t<a href=\"http://globocan.iarc.fr/Pages/glossary.aspx\">http://globocan.iarc.fr/Pages/glossary.aspx</a>\r\n\t</p>\r\n\t<p>Incidence is the number of new cases arising in a given period in a specified population. This information is collected routinely by cancer registries. It can be expressed as an absolute number of cases per year or as a rate per 100,000 persons per year.<sup>*</sup>\r\n\tThe rate provides an approximation of the average risk of developing a cancer.\r\n\t</p>\r\n\t<p>\r\n<sup>*</sup>\r\nOnly age-standardized rates per 100,000 persons per year are shown here\r\n\t</p>\r\n</div>", layer_provider: "cartodb", css: "/** choropleth visualization */\r\n\r\n#crm_globocan_2012 {\r\n  polygon-fill: transparent;\r\n  polygon-opacity: 0.8;\r\n  line-color: #FFF;\r\n  line-width: 1;\r\n  line-opacity: 1;\r\n}\r\n#crm_globocan_2012 [ value > 242.9] {\r\n  polygon-fill: #CD0000;\r\n}\r\n#crm_globocan_2012 [ value <= 242.9] {\r\n  polygon-fill: #D84948;\r\n}\r\n#crm_globocan_2012 [ value <= 172.3] {\r\n  polygon-fill: #E18683;\r\n}\r\n#crm_globocan_2012 [ value <= 137.5] {\r\n  polygon-fill: #E8B7B3;\r\n}\r\n#crm_globocan_2012 [ value <= 101.3] {\r\n  polygon-fill: #E9C0BC;\r\n}\r\n", interactivity: "", opacity: 1.0, query: "SELECT \r\nb.admin AS country_name, \r\na.iso AS country_iso, \r\na.incidence AS value,\r\nb.the_geom_webmercator\r\nFROM crm_globocan_2012 a, crm_countries_geoms b\r\nWHERE a.iso = b.adm0_a3\r\nORDER BY b.admin", created_at: "2016-10-10 10:53:52", updated_at: "2016-11-07 17:47:34", locate_layer: true, icon_class: nil, published: true, legend: "{\r\n  \"type\": \"choropleth\",\r\n  \"items\": [{\"value\": \"> 242.9\", \"color\": \"#CD0000\"}, \r\n                {\"value\": \"172.3 - 242.9\", \"color\": \"#D84948\"}, \r\n                {\"value\": \"137.5 - 172.3\", \"color\": \"#E18683\"}, \r\n                {\"value\": \"101.3 - 137.5\", \"color\": \"#E8B7B3\"},\r\n                {\"value\": \"0 - 101.3\", \"color\": \"#E9C0BC\"}],\r\n  \"Metrics\": \"Incidence: * per 100,000 persons per year\"\r\n}", source: ""},
  {id: 15, layer_group_id: nil, name: "Cancer Mortality, ASR all years Globocan", slug: "mortality-asr-all-years-globocan", layer_type: "layer", zindex: 1, active: true, order: 0, color: nil, info: "\r\n\t<h2>MORTALITY</h2>\r\n\t<p>\r\n\t\tGLOBOCAN 2012, IARC -11.8.2014: \r\n\t\t<a href=\"http://globocan.iarc.fr/Pages/glossary.aspx\">http://globocan.iarc.fr/Pages/glossary.aspx</a>\r\n\t</p>\r\n\t<p>Mortality is the number of deaths occurring in a given period in a specified population. It can be expressed as an absolute number of deaths per year or as a rate per 100,000 persons per year.<sup>*</sup>\r\n\t</p>\r\n\t<p>\r\n<sup>*</sup>\r\nOnly age-standardized rates per 100,000 persons per year are shown here\r\n\t</p>\r\n", layer_provider: "cartodb", css: "/** choropleth visualization */\r\n\r\n#crm_globocan_2012 {\r\n  polygon-fill: transparent;\r\n  polygon-opacity: 0.8;\r\n  line-color: #FFF;\r\n  line-width: 1;\r\n  line-opacity: 1;\r\n}\r\n#crm_globocan_2012 [ value > 116.8] {\r\n  polygon-fill: #844300;\r\n}\r\n#crm_globocan_2012 [ value <= 116.8] {\r\n  polygon-fill: #A47848;\r\n}\r\n#crm_globocan_2012 [ value <= 99.6] {\r\n  polygon-fill: #BFA483;\r\n}\r\n#crm_globocan_2012 [ value <= 89.7] {\r\n  polygon-fill: #D3C9B1;\r\n}\r\n#crm_globocan_2012 [ value <= 73.3] {\r\n  polygon-fill: #D9CFBC;\r\n}", interactivity: "", opacity: 1.0, query: "SELECT\r\n  b.admin AS country_name,\r\n  a.iso AS country_iso,\r\n  a.mortality AS value,\r\n  b.the_geom_webmercator\r\nFROM crm_globocan_2012 a, crm_countries_geoms b\r\nWHERE a.iso = b.adm0_a3\r\nORDER BY b.admin", created_at: "2016-10-10 12:00:24", updated_at: "2016-11-08 10:12:42", locate_layer: true, icon_class: nil, published: true, legend: "{\r\n  \"type\": \"choropleth\",\r\n  \"items\": [{\"value\": \"> 116.8\", \"color\": \"#844300\"}, \r\n                {\"value\": \"<= 116.8\", \"color\": \"#A47848\"}, \r\n                {\"value\": \"<= 99.6\", \"color\": \"#BFA483\"}, \r\n                {\"value\": \"<= 8